import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const AddPesanan = () => {

    const navigate = useNavigate();//untuk navigasi halaman
    const [nomor, setNomor] = useState("");
    const [jenis, setJenis] = useState("");
    const [nama, setNama] = useState("");
    const [harga, setHarga] = useState("");
    const [qty, setQty] = useState("");
    const [total, setTotal] = useState("");



    const savePesanan = async (e) => {
        e.preventDefault();
        const formData = new FormData();
        formData.append("nomor", nomor);
        formData.append("nama", nama);
        formData.append("jenis", jenis);
        formData.append("harga", harga);
        formData.append("qty", qty);
        formData.append("total", total);

        try {
            await axios.post("http://localhost:5000/pesanan", formData, {
                headers: {
                    "Content-type": "multipart/form-data",
                },
            });
            navigate("/pesanan");
        } catch (error) {
            console.log(error);
        }
    };




    return (



        <div className="columns is-centered mt-5">

            <div className="column is-half">

                {/* <!-- Button trigger modal --> */}
                <button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal">
                    Cari Pesanan
                </button>

                {/* <!-- Modal --> */}
                <div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                    <div class="modal-dialog">
                        <div class="modal-content">
                            <div class="modal-header">
                                <h1 class="modal-title fs-5" id="exampleModalLabel">Modal title</h1>
                                <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                            </div>
                            <div class="modal-body">
                                ...
                            </div>
                            <div class="modal-footer">
                                <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                                <button type="button" class="btn btn-primary">Save changes</button>
                            </div>
                        </div>
                    </div>
                </div>



                <form onSubmit={savePesanan}>

                    <div className="field">
                        <label className="label">Nomor</label>
                        <div className="control">
                            <input
                                type="text"
                                className="input"
                                value={nomor}
                                onChange={(e) => setNomor(e.target.value)}
                                placeholder="Nomor"
                            />
                        </div>
                    </div>

                    <div className="field">
                        <label className="label">Nama</label>
                        <div className="control">
                            <input
                                type="text"
                                className="input"
                                value={nama}
                                onChange={(e) => setNama(e.target.value)}
                                placeholder="nama"
                            />
                        </div>
                    </div>

                    <div className="field">
                        <label className="label">Jenis</label>
                        <div className="control">
                            <input
                                type="text"
                                className="input"
                                value={jenis}
                                onChange={(e) => setJenis(e.target.value)}
                                placeholder="jenis"
                            />
                        </div>
                    </div>

                    <div className="field">
                        <label className="label">Harga</label>
                        <div className="control">
                            <input
                                type="text"
                                className="input"
                                value={harga}
                                onChange={(e) => setHarga(e.target.value)}
                                placeholder="harga"
                            />
                        </div>
                    </div>

                    <div className="field">
                        <label className="label">Qty</label>
                        <div className="control">
                            <input
                                type="text"
                                className="input"
                                value={qty}
                                onChange={(e) => setQty(e.target.value)}
                                placeholder="qty"
                            />
                        </div>
                    </div>

                    <div className="field">
                        <label className="label">Total</label>
                        <div className="control">
                            <input
                                type="text"
                                className="input"
                                value={total}
                                onChange={(e) => setTotal(e.target.value)}
                                placeholder="total"
                            />
                        </div>
                    </div>

                    <div className="field">
                        <div className="control">
                            <button
                                type="submit"
                                className="btn btn-success">
                                Simpan
                            </button>
                        </div>
                    </div>

                </form>

            </div>
        </div>
    );
};

export default AddPesanan;
